import Vue from 'vue'
import VueRouter from 'vue-router'
import FiveDay from '@/views/5Day.vue';
import MySavedLocations from '@/views/MySavedLocations.vue';
import HourlyForecast from '@/views/HourlyForecast.vue';



Vue.use(VueRouter)

const routes = [

  {
    path: '/forecast',
    name: 'FiveDayForecast',
    component: FiveDayForecast,
    props: true
  },
  {
    path: '/saved-locations',
    name: 'SavedLocations',
    component: MySavedLocations
  },
  {
    path: '/hourly-forecast',
    name: 'HourlyForecast',
    component: HourlyForecast,
    props: true
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
